import React from 'react';
import styles from './RemedyDetails.module.css'

const RemedyDetails = ({ remedyData }) => {
  return (
    <div clas>
      <h2>Diagnosis: {remedyData.Diagnosis}</h2>
      <h3>How to prepare it:</h3>
      <ul>
        {remedyData['How to prepare it'].map((step, index) => (
          <li key={index}>
            <strong>{step.Food}:</strong> {step.Preparation}
          </li>
        ))}
      </ul>
      <h3>What to eat:</h3>
      <ul>
        {remedyData['What to eat'].map((food, index) => (
          <li key={index}>
            <strong>{food.Food}:</strong> {food.Reason}
          </li>
        ))}
      </ul>
      <h3>When to eat:</h3>
      <ul>
        {remedyData['When to eat'].map((meal, index) => (
          <li key={index}>
            <strong>{meal.Time}:</strong> {meal.Meal}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RemedyDetails;
